script: |
  super -f text -I q76.spq | sort > q76.out

inputs:
  - name: q76.spq
    data: |
      SELECT + + col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col0 ) <= 6 * - + 96 * col2 * - ( col1 ) + - + col2;
  - name: tab1

outputs:
  - name: q76.out
    data: |
      14
      47
      5
